AlcoholDelivery.factory('ScrollPaging', ['$http',function($http) {
  var ScrollPaging = function(args,url) {
    this.items = [];
    this.busy = false;
    this.limitreached = false;
    // this.totalResult = 0;
    this.url = url;
    this.params = args;
    this.params.skip = 0;
    this.data = {};
    //SET DEFAULT LIMIT IF NOT SPECIFIED
    if(!this.params.take)
    	this.params.take = 10;
  };

  ScrollPaging.prototype.nextPage = function() {
    if (this.busy || this.limitreached) return;
    this.busy = true;
    $http.get(this.url,{
    	params : this.params
    }).then(function(result){
		this.data = result.data;
		var items = result.data.items;
		this.totalResult = result.data.total;
		for (var i = 0; i < items.length; i++) {
			this.items.push(items[i]);
		}
		this.busy = false;
		if(result.data.items.length < parseInt(this.params.take)){
			this.limitreached = true;
		}else{
			this.params.skip+=parseInt(this.params.take);
		}

	}.bind(this));
  };

  return ScrollPaging;

}]);

AlcoholDelivery.factory('ScrollPagination', ['$http','ProductService',function($http,ProductService) {

  var Search = function(keyword,filter,sortby,type,parent) {
    this.items = [];
    this.busy = false;
    this.skip = 0;
    this.keyword = keyword;
    this.take = 10;
    this.limitreached = false;
    this.totalResult = 0;
    this.filter = filter;
    this.sortby = sortby;
    this.type = type || 1;
    this.parent = parent || '';
  };

  Search.prototype.nextPage = function() {
    if (this.busy || this.limitreached) return;
    this.busy = true;
    var _self = this;

    ProductService.getProducts({

		type : this.type, // [1 for loyalty store]
		skip:this.skip,
		limit:this.take,
		filter:this.filter,
		sort:this.sortby,
		keyword:this.keyword,
		productList:1,
		parent:this.parent
	}).then(function(items){

		// _self.totalResult = result.data.total;
		for (var i = 0; i < items.length; i++) {
			_self.items.push(items[i]);
		}
		_self.busy = false;
		if(items.length < parseInt(_self.take)){
			_self.limitreached = true;
		}else{
			_self.skip+= parseInt(_self.take);
		}

	}.bind(_self));

  };

  return Search;

}]);

